import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Box,
  Container,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  CircularProgress
} from '@mui/material';
import { Line } from 'react-chartjs-2';
import AddPerformanceModal from './AddPerformanceModal';

const PerformanceTracker = () => {
  const [performances, setPerformances] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedEvent, setSelectedEvent] = useState('50_FR_SCY');
  const [showAddModal, setShowAddModal] = useState(false);
  const [chartData, setChartData] = useState(null);

  useEffect(() => {
    fetchPerformances();
  }, [selectedEvent]);

  const fetchPerformances = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await axios.get(`${process.env.REACT_APP_API_URL}/api/performance/performances/${selectedEvent}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setPerformances(response.data);
      prepareChartData(response.data);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching performances:', error);
      setLoading(false);
    }
  };

  const prepareChartData = (data) => {
    const sortedData = [...data].sort((a, b) => new Date(a.date) - new Date(b.date));

    setChartData({
      labels: sortedData.map(p => new Date(p.date).toLocaleDateString()),
      datasets: [{
        label: 'Time (seconds)',
        data: sortedData.map(p => convertTimeToSeconds(p.time)),
        fill: false,
        borderColor: 'rgb(75, 192, 192)',
        tension: 0.1
      }]
    });
  };

  const convertTimeToSeconds = (timeStr) => {
    const [mins, secs] = timeStr.split(':');
    return parseFloat(mins) * 60 + parseFloat(secs);
  };

  const formatTime = (timeStr) => {
    return timeStr.replace(/^0+:/, '');
  };

  const handleAddPerformance = async (newPerformance) => {
    try {
      const token = localStorage.getItem('token');
      await axios.post(`${process.env.REACT_APP_API_URL}/api/performance/performances`, 
        { ...newPerformance, event: selectedEvent },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setShowAddModal(false);
      fetchPerformances();
    } catch (error) {
      console.error('Error adding performance:', error);
    }
  };

  if (loading) {
    return <CircularProgress />;
  }

  return (
    <Container maxWidth="lg">
      <Box sx={{ my: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          Performance Tracker
        </Typography>

        <Button 
          variant="contained" 
          color="primary" 
          onClick={() => setShowAddModal(true)}
          sx={{ mb: 3 }}
        >
          Add New Performance
        </Button>

        {chartData && (
          <Box sx={{ mb: 4 }}>
            <Paper sx={{ p: 2 }}>
              <Typography variant="h6" gutterBottom>
                Performance Trend
              </Typography>
              <Line data={chartData} options={{
                scales: {
                  y: {
                    reverse: true,
                    title: {
                      display: true,
                      text: 'Time (seconds)'
                    }
                  }
                }
              }} />
            </Paper>
          </Box>
        )}

        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Date</TableCell>
                <TableCell>Time</TableCell>
                <TableCell>Competition</TableCell>
                <TableCell>Personal Best</TableCell>
                <TableCell>FINA Points</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {performances.map((performance) => (
                <TableRow key={performance._id}>
                  <TableCell>{new Date(performance.date).toLocaleDateString()}</TableCell>
                  <TableCell>{formatTime(performance.time)}</TableCell>
                  <TableCell>
                    {performance.competition ? performance.competition.name : 'Training'}
                  </TableCell>
                  <TableCell>{performance.isPersonalBest ? 'Yes' : 'No'}</TableCell>
                  <TableCell>{performance.finaPoints}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Box>

      <AddPerformanceModal
        open={showAddModal}
        onClose={() => setShowAddModal(false)}
        onSubmit={handleAddPerformance}
      />
    </Container>
  );
};

export default PerformanceTracker;
